import React from "react";
import "./AddPlace.css";

import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import InputAdornment from "@mui/material/InputAdornment";
import Button from "@mui/material/Button";

import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";

const AddPlace = () => {
  const buttonStyle = {
    backgroundColor: "#1ca395",
  };

  return (
    <div className="addplace-container">
      <h1 style={{ color: "#343a40" }}> Add a Pet Friendly Place </h1>
      <div style={{ display: "flex" }}>
        <Box
          component="form"
          sx={{
            "& > :not(style)": { m: 1, width: "60ch" },
            display: "flex",
            flexDirection: "column",
          }}
          noValidate
          autoComplete="off"
        >
          <TextField id="outlined-basic" label="Title" variant="outlined" />
          <TextField id="outlined-basic" label="Address" variant="outlined" />
          <TextField id="outlined-basic" label="Longitude" variant="outlined" />
          <TextField id="outlined-basic" label="Latitude" variant="outlined" />
          <select
            className="form-control"
            onChange={(e) => setCategory(e.target.value)}
            style={
              (category === "" || category === "Select a Category") &&
              createFieldsFilled === false
                ? styles
                : null
            }
          >
            <option defaultValue>Select a Category</option>
            <option value="Resturant">Resturant</option>
            <option value="Cafe">Cafe</option>
            <option value="Pub">Pub</option>
            <option value="Park">Park</option>
            <option value="Hotel">Hotel</option>
          </select>
        </Box>
        <Box
          component="form"
          sx={{
            "& > :not(style)": { m: 1, width: "60ch" },
            display: "flex",
            flexDirection: "column",
          }}
          noValidate
          autoComplete="off"
        >
          <TextField
            id="outlined-basic"
            label="Postal Code"
            variant="outlined"
          />
          <FormControl sx={{ m: 1, minWidth: 120 }}>
            <InputLabel id="demo-simple-select-helper-label">
              Category
            </InputLabel>
            <Select
              labelId="demo-simple-select-helper-label"
              id="demo-simple-select-helper"
              label="Age"
            >
              <MenuItem value="Restaurant">Restaurant</MenuItem>
              <MenuItem value="Cafe">Cafe</MenuItem>
              <MenuItem value="Pub">Pub</MenuItem>
              <MenuItem value="Park">Park</MenuItem>
              <MenuItem value="Hotel">Hotel</MenuItem>
            </Select>
          </FormControl>
          <TextField id="outlined-basic" label="Phone" variant="outlined" />
          <TextField id="outlined-basic" label="Email" variant="outlined" />
          <TextField
            id="outlined-start-adornment"
            sx={{ m: 1, width: "25ch" }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">https://</InputAdornment>
              ),
            }}
          />
        </Box>
      </div>
      <div style={{ display: "flex", marginTop: "20px", marginLeft: "10px" }}>
        <Button style={buttonStyle} variant="contained">
          Add Place
        </Button>
      </div>
    </div>
  );
};

export default AddPlace;
